;; @@
;; A function that extracts a set of coordinates from every scored individual.
(defn extract-coords
  [indv]
 (list (:score-2 indv) (:score-1 indv)))
;; @@

;; @@
;; Apply extract-coords to every individual.
(def points (map #(extract-coords %) scored-individuals))
;; @@
